import React, { Component } from "react";

const styles = {
  layout: {
    backgroundColor: "white",
    color: "#0A283E",
    display: "flex",
    alignItems: "center",
    gap:'5%',
  },
};
class Layout extends Component {
  render() {
    return (
      <div style={styles.layout}>
        <div>{this.props.children}</div>
      </div>
    );
  }
}

export default Layout;
